
CREATE TABLE IF NOT EXISTS `mental_health_male` (
  `User_ID` INT NULL,
  `Age` INT NULL,
  `Gender` VARCHAR(16) NULL,
  `Daily_Screen_Time(hrs)` DECIMAL(5,2) NULL,
  `Sleep_Quality(1-10)` TINYINT NULL,
  `Stress_Level(1-10)` TINYINT NULL,
  `Days_Without_Social_Media` INT NULL,
  `Exercise_Frequency(week)` INT NULL,
  `Social_Media_Platform` VARCHAR(64) NULL,
  `Happiness_Index(1-10)` TINYINT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

